export default function Card(props)
{
    return(
        <div className="card">
            <div>
                <img src={props.content.company_logo} />
            </div>
            <div>
            {props.content.company}
            </div>
            <div>
                <ul>
                    {props.content.keywords}
                </ul>
            </div>
            <div>{props.content.location}</div>
            <div>{props.content.position}</div>
            <div>{props.content.postedOn}</div>
            <div>{props.content.timing}</div>
        </div>
    );
}
